import React, { useState, useEffect } from 'react';
import { Form, Button, Card, Alert } from 'react-bootstrap';
import axios from 'axios';

const Reports = () => {
  const [formData, setFormData] = useState({
    faculty_name: '',
    class_name: '',
    week_of_reporting: '',
    date_of_lecture: '',
    course_name: '',
    course_code: '',
    lecturer_name: '',
    actual_students: '',
    total_registered: '',
    venue: '',
    scheduled_time: '',
    topic_taught: '',
    learning_outcomes: '',
    recommendations: ''
  });
  const [reports, setReports] = useState([]);
  const [error, setError] = useState(null);

  const onChange = (e) => setFormData({ ...formData, [e.target.name]: e.target.value });

  const fetchReports = async (q = '') => {
    const token = localStorage.getItem('token');
    console.log('Token used:', token);
    if (!token) {
      setError('No authentication token. Please log in again.');
      return;
    }
    try {
      setError(null);
      const res = await axios.get(`${process.env.REACT_APP_API_URL.replace(/\/$/, '')}/reports${q ? `?q=${q}` : ''}`, {
        headers: { 'x-auth-token': token }
      });
      setReports(res.data);
    } catch (err) {
      console.error('Fetch error:', err.response ? err.response.data : err);
      setError('Failed to load reports. ' + (err.response?.data?.msg || 'Check server or token.'));
    }
  };

  const onSubmit = async (e) => {
    e.preventDefault();
    try {
      setError(null);
      const submitData = {
        faculty_name: formData.faculty_name,
        class_name: formData.class_name,
        week_of_reporting: parseInt(formData.week_of_reporting) || 0,
        date_of_lecture: new Date(formData.date_of_lecture).toISOString().split('T')[0],
        course_name: formData.course_name,
        course_code: formData.course_code,
        lecturer_name: formData.lecturer_name,
        actual_number_of_students_present: parseInt(formData.actual_students) || 0,
        total_number_of_registered_students: parseInt(formData.total_registered) || 0,
        venue: formData.venue,
        scheduled_lecture_time: formData.scheduled_time,
        topic_taught: formData.topic_taught,
        learning_outcomes: formData.learning_outcomes,
        recommendations: formData.recommendations
      };
      console.log('Submitting data:', submitData);
      const token = localStorage.getItem('token');
      if (!token) throw new Error('No token. Please log in.');
      const res = await axios.post(`${process.env.REACT_APP_API_URL.replace(/\/$/, '')}/reports`, submitData, {
        headers: { 'x-auth-token': token }
      });
      alert('Report submitted successfully');
      setFormData({
        faculty_name: '', class_name: '', week_of_reporting: '', date_of_lecture: '',
        course_name: '', course_code: '', lecturer_name: '', actual_students: '',
        total_registered: '', venue: '', scheduled_time: '', topic_taught: '',
        learning_outcomes: '', recommendations: ''
      });
      fetchReports();
    } catch (err) {
      console.error('Submit error:', err.response ? err.response.data : err);
      setError('Failed to submit report. ' + (err.response?.data?.msg || 'Check form data or server.'));
    }
  };

  useEffect(() => {
    fetchReports();
  }, []);

  return (
    <Card className="p-4">
      <h2>Submit Report</h2>
      {error && <Alert variant="danger">{error}</Alert>}
      <Form onSubmit={onSubmit}>
        <Form.Group controlId="faculty_name" className="mb-3">
          <Form.Label>Faculty Name</Form.Label>
          <Form.Control
            type="text"
            name="faculty_name"
            value={formData.faculty_name}
            onChange={onChange}
            required
          />
        </Form.Group>
        {/* Add other form fields similarly (e.g., class_name, date_of_lecture, etc.) */}
        <Button variant="primary" type="submit">
          Submit Report
        </Button>
      </Form>
      <h3>Reports</h3>
      {reports.length ? (
        <ul>
          {reports.map((report) => (
            <li key={report.id}>{report.topic_taught}</li>
          ))}
        </ul>
      ) : (
        <p>No reports available.</p>
      )}
    </Card>
  );
};

export default Reports;
